import React from "react";
import "./style/slider.css";

const customersReview = [
  {
    id: 1,
    text: "amazing service",
  },
  {
    id: 1,
    text: "amazing service",
  },
  {
    id: 1,
    text: "amazing service",
  },
  {
    id: 1,
    text: "amazing service",
  },
  {
    id: 1,
    text: "amazing service",
  },
];
function SliderCarousel() {
  return (
    <>
      <div className="sliderContainer">
        <h3>Fresh Start</h3>
        <h3>Fresh Start</h3>
        <h3>Fresh Start</h3>
        <h3>Fresh Start</h3>
        <h3>Fresh Start</h3>
        <h3>Fresh Start</h3>
      </div>
    </>
  );
}
export default SliderCarousel;
